  \"Advanced Durable Flexible Ultra Low Outgassing Thermal Control Coatings for NASA
  Science Missions Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T05:56:44.054717\",\n\t\"name\": \"advanced-durable-flexible-ultra-low-outgassing-thermal-control-coatings-for-nasa-science-m\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This Phase I program proposes to synthesize
  novel nanoengineered ultra low out gassing elastomers and formulate high temperature
  capable flexible thermal control coatings as well as adhesives based on the proposed
  chemistries that are stable in various space environments. We have envisioned nano-engineered
  clusters and the innovative synthesis of the poly carborane-polysiloxanes, to surpass
  the performance of the current state of the art and provide the formulations that
  are space environment stable and can provide radiation hardening and enhanced life
  long survivability for science mission hardware in space environments. We propose
  to investigate: (1) Synthesis of high molecular weight ultra low outgassing poly-carborane-siloxanes
  that are stable and demonstrate for temperatures &amp;#8805; 500&amp;#61616;C. (2)
  Use of nano-engineered clusters with appropriate cross linker chemistries for tailoring
  secondary emission properties while providing protection from the irradiation using
  electron donor compounds. This can help us to employ electron on demand strategy
  to mitigate the secondary and sustained arcs. (3) Investigations in to: thermal
  stability thermally induced out-gassing studies, ESD behavior, and space environment
  simulation of elastomers for the typical GEO and LEO scenarios. These results from
  this study will guide us to select the promising formulations for the scale up and
  validation studies in Phase II. Lastly, we have proposed investigations in Boron
  Nitride Self Assembled Nano Cluster Mesh (BN-SANCs&lt;SUP&gt;TM&lt;/SUP&gt;), which
  may totally change the way we formulate the space stable thermal control material
  systems for all earth orbits and planetary environment, along with its use in radiation
  shielding with use of 10BN-SANCs&lt;SUP&gt;TM&lt;/SUP&gt;. \",\n\t\"license_title\":
